INSERT INTO `comments` VALUES (1, '卢山', 1, '酒店位置还是不错的！遗憾的是天气不够热不好下水', '2018-01-01', 1, '满意', NULL, NULL, NULL);
INSERT INTO `comments` VALUES (2, '卢山', 1, '酒店特别好，可以近距离看到海，特别蓝，地方很悠闲，适合度假，回来后也很想念。', '2018-01-02', 2, '一般', NULL, NULL, NULL);
INSERT INTO `comments` VALUES (3, '板砖', 1, '挺好的一次旅游，酒店很舒服，可以看到海，对这个地方有很多美好回忆。', '2018-04-02', 3, '不满意', NULL, NULL, NULL);
INSERT INTO `comments` VALUES (4, '奥利奥', 1, '地方风景不错，海滩狼比较大，泥沙多，不适合游泳。周边饮食很多，但是大多口味不咋地。机场绝对是当地一大特色（负能量），人多，机场小，服务差，脏乱。', '2018-05-01', 4, '一般', NULL, NULL, NULL);
INSERT INTO `comments` VALUES (5, '平底锅', 1, '鲲游包机，交通一般，是因为这个地方的机场实在不行。安检口少人还多，值机都能排队一个小时。', '2018-04-10', 5, '满意', NULL, NULL, NULL);
INSERT INTO `comments` VALUES (20, '3.6', 1, 'fdsfds', '2018-05-29', 13, '满意', NULL, NULL, NULL);
INSERT INTO `comments` VALUES (21, '卢山', 1, '还不错，就是有些累。哈哈哈', '2018-09-04', 24, '满意', NULL, NULL, NULL);
