INSERT INTO `product` VALUES (3, '新加坡-民丹岛5或6日游', 2380, 99, 'product@3.jpg', NULL, 13, '杭州直飞、红树林生态之旅、出海浮潜、充足自由活动、一日游两国', '1', 3, '跟团游', '杭州', NULL, NULL, '2018-12-10 23:45:07', '2018-12-03 21:36:12');
INSERT INTO `product` VALUES (4, '莫斯科-彼得堡金环小镇9日游', 6942, 99, 'product@4.jpg', NULL, 13, '杭州/温州/宁波/上海/免费联运，双点进出口不走回头路，圣彼得堡，冬夏宫花园，红场，谢尔盖耶夫小镇', '1', 4, '自由行', '多地点', NULL, NULL, '2018-12-08 00:00:00', '2018-12-01 14:35:52');
INSERT INTO `product` VALUES (5, '斐济Lomani洛玛尼6晚8日自由行', 12644, 99, 'product@3.jpg', NULL, 13, '蜜月型度假村，儿童不能入住，A级沙质，浮潜圣地，邂逅海豚，全国13个城市出发可选', '1', 1, '自由行', '多地点', 500, NULL, '2018-12-09 04:00:18', '2018-12-02 06:36:23');
